import "./secondpage.css";
const SecondPage = () => {
  return (
    <div>
      <h1>Second Page</h1>
      <div className="container">
        <div className="MenuList"></div>
        <div className="RightSidebar"></div>
      </div>
    </div>
  );
};

export default SecondPage;
